import React from 'react'
import styled from 'styled-components'

export const CoinImg = styled.img`
    grid-row: 1 / 3;
    align-self: center;
    justify-self: center;
`

export const CoinImage = ({ coin , style}) => {
    return (

            <CoinImg
                alt={coin.CoinSymbol}
                style={style || {height: '50px'}}
                src={`http://cryptocompare.com/${coin.ImageUrl}`}
            />
    )
}
